import styled from 'styled-components';

import logo from '../../assets/logo.svg';

export const Container = styled.div`
  background: #000;
  height: 100vh;
  justify-items: center;
  align-items: center;
  display: flex;
`;
export const Logo = styled.h1`
  width: 340px;
  height: 155px;
  background-image: url(${logo});
  overflow: hidden;
  text-indent: -999px;
`;
